package org.giddap.dreamfactory.leetcode.onlinejudge;

import org.giddap.dreamfactory.leetcode.commons.UndirectedGraphNode;
import org.giddap.dreamfactory.leetcode.onlinejudge.implementations.CloneGraphBfsIterativeImpl;
import org.junit.Test;

import static org.junit.Assert.assertEquals;

/**
 *
 */
public class CloneGraphTest {
    private CloneGraph solution = new CloneGraphBfsIterativeImpl();

    @Test
    public void small01() {
        UndirectedGraphNode node0 = new UndirectedGraphNode(0);
        UndirectedGraphNode node1 = new UndirectedGraphNode(1);
        UndirectedGraphNode node2 = new UndirectedGraphNode(2);

        node0.neighbors.add(node1);
        node0.neighbors.add(node2);

        node1.neighbors.add(node0);
        node1.neighbors.add(node2);

        node2.neighbors.add(node0);
        node2.neighbors.add(node1);
        node2.neighbors.add(node2);

        UndirectedGraphNode actual0 = solution.cloneGraph(node0);
        assertEquals(node0.label, actual0.label);
        assertEquals(2, actual0.neighbors.size());
        assertEquals(node1.label, actual0.neighbors.get(0).label);
        assertEquals(node2.label, actual0.neighbors.get(1).label);

        UndirectedGraphNode actual1 = actual0.neighbors.get(0);
        assertEquals(2, actual1.neighbors.size());
        assertEquals(node0.label, actual1.neighbors.get(0).label);
        assertEquals(node2.label, actual1.neighbors.get(1).label);

        UndirectedGraphNode actual2 = actual0.neighbors.get(1);
        assertEquals(3, actual2.neighbors.size());
        assertEquals(node0.label, actual2.neighbors.get(0).label);
        assertEquals(node1.label, actual2.neighbors.get(1).label);
        assertEquals(node2.label, actual2.neighbors.get(2).label);
    }
}

